import axios from "axios";
import { apiUrl } from '../config.json';
import http from "./httpService";

const apiEndpoint = apiUrl + "post";

export function createPost(t, s, f, c) {
    http.post(apiEndpoint, {
        title: t,
        summary: s,
        cover: f,
        content: c
    })
}

export default createPost;
